ormation on FPI projects (financed through the Instrument contributing to Stability and Peace and the Partnership Instrument) and election observation missions to Pakistan. Information includes title and description of projects and data on budget, participants, thematic areas and status. The dataset is updated on a monthly basis.\n\nThe Service for Foreign Policy Instruments (FPI) supports the EU to achieve its foreign and security policy objectives, in particular with regards to peace and conflict prevention, and to project the EU\'s interests and image in the world. Working in a wide range of areas with various partners and stakeholders FPI contributes to the achievement of the general objective of the EU to become \'a stronger global actor\'.\n\nTo achieve its objective FPI is responsible for the operational and financial management of the budgets for Common Foreign and Security Policy (CFSP), Instrument contributing to Stability and Peace (IcSP), Partnership Instrument (PI), Election Observation Missions (EOMs), Press and Public Diplomacy (PPD) as well as the implementation of Foreign Policy Regulatory Instruments (sanctions, the Kimberley Process on conflict diamonds and the Anti-Torture Regulation). \n\nFPI delivers on its objectives in an open and accountable fashion.</dc:description>\n    <dc:identifier>74787</dc:identifier>\n    <dc:title>European Commission – Service for Foreign Policy Instruments – FPI projects and election observation missions to Pakistan</dc:title>\n    <dcat:dataset rdf:resource=\"http://opendata.org/resource/Fpi_projects_and_election_observation_missions_in_pakistan_535\"/>\n    <dcat:dataset rdf:resource=\"http://opendata.org/resource/Preview_of_fpi_projects_and_election_observation_missions_in_pakistan_295\"/>\n    <dcat:themeTaxonomy rdf:resource=\"http://opendata.org/resource/Groups_from_european_commission_service_for_foreign_policy_instruments_fpi_projects_and_election_observation_missions_to_pakistan\"/>\n    <dcat:themeTaxonom