a.gov.au/\"/>\n  </dcat:Catalog>\n\n  <dcat:Dataset rdf:about=\"http://opendata.org/resource/Gini_index_world_bank_estimate__246\">\n    <rdfs:label>GINI index (World Bank estimate)</rdfs:label>\n    <dc:description>From API. Source: World Bank, Development Research Group. Data are based on primary household survey data obtained from government statistical agencies and World Bank country departments. For more information and methodology, please see PovcalNet (http://iresearch.worldbank.org/PovcalNet/index.htm).  \n   \nGini index measures the extent to which the distribution of income (or, in some cases, consumption expenditure) among individuals or households within an economy deviates from a perfectly equal distribution. A Lorenz curve plots the cumulative percentages of total income received against the cumulative number of recipients, starting with the poorest individual or household. The Gini index measures the area between the Lorenz curve and a hypothetical line of absolute equality, expressed as a percentage of the maximum area under the line. Thus a Gini index of 0 represents perfect equality, while an index of 100 implies perfect inequality.</dc:description>\n    <dc:issued>2017-06-28T08:12:14.238613</dc:issued>\n    <dc:title>GINI index (World Bank estimate)</dc:title>\n    <dcat:distribution rdf:resource=\"http://opendata.org/resource/dist_Gini_index_world_bank_estimate__246\"/>\n    <dcat:theme rdf:resource=\"http://opendata.org/resource/Thailand\"/>\n    <dcat:theme rdf:resource=\"http://opendata.org/resource/Financial_sector\"/>\n    <dcat:theme rdf:resource=\"http://opendata.org/resource/Health\"/>\n    <dcat:theme rdf:resource=\"http://opendata.org/resource/Energy\"/>\n    <dcat:theme rdf:resource=\"http://opendata.org/resource/Indicators\"/>\n    <dcat:theme rdf:resource=\"http://opendata.org/resource/Infrastructure\"/>\n    <dcat:theme rdf:resource=\"http://opendata.org/resource/Environment\"/>\n    <dcat:theme rdf:resource=\"http://opendata.org/r